  "displayName": "RunPod GPU Monitor",
  "description": "Monitor and control RunPod GPU endpoints from VS Code status bar",
  "version": "1.0.0",
  "publisher": "imorgado",
  "engines": {
    "vscode": "^1.85.0"
  },
  "categories": [
    "Other"
  ],
  "activationEvents": [
    "onStartupFinished"
  ],
  "main": "./out/extension.js",
