    "commands": [
      {
        "command": "runpod.showStatus",
        "title": "RunPod: Show GPU Status"
      },
      {
        "command": "runpod.pauseAll",
        "title": "RunPod: Pause All Endpoints"
      },
      {
        "command": "runpod.resumeAll",
        "title": "RunPod: Resume All Endpoints"
      },
      {
        "command": "runpod.pauseEndpoint",
        "title": "RunPod: Pause Endpoint"
      },
      {
        "command": "runpod.resumeEndpoint",
        "title": "RunPod: Resume Endpoint"
      },
      {
        "command": "runpod.showCosts",
        "title": "RunPod: Show Cost Report"
      },
      {
        "command": "runpod.refresh",
        "title": "RunPod: Refresh Status"
      }
    ],
    "configuration": {
      "title": "RunPod GPU Monitor",
      "properties": {
        "runpod.apiKey": {
          "type": "string",
          "default": "",
          "description": "Your RunPod API key"
        },
        "runpod.refreshInterval": {
          "type": "number",
          "default": 30,
          "description": "Status refresh interval in seconds"
        },
        "runpod.showCostInStatusBar": {
          "type": "boolean",
          "default": true,
          "description": "Show running cost in status bar"
        },
        "runpod.endpoints": {
          "type": "object",
          "default": {},
          "description": "Endpoint configurations (id -> {name, gpu, hourlyRate})"
        },
        "runpod.costTrackerPath": {
          "type": "string",
          "default": "~/cost_tracker.py",
          "description": "Path to cost_tracker.py"
        }
      }
    },
    "menus": {
      "commandPalette": [
        {
          "command": "runpod.showStatus"
        },
        {
          "command": "runpod.pauseAll"
        },
        {
          "command": "runpod.resumeAll"
        },
        {
          "command": "runpod.showCosts"
        }
      ]
    }
  },
  "scripts": {
    "vscode:prepublish": "npm run compile",
    "compile": "tsc -p ./",
    "watch": "tsc -watch -p ./",
    "package": "vsce package"
  },
  "devDependencies": {
    "@types/node": "^20.10.0",
    "@types/vscode": "^1.85.0",
    "typescript": "^5.3.0",
    "@vscode/vsce": "^2.22.0"
  },
  "dependencies": {
    "axios": "^1.6.0"
  }
}

