def delete_endpoint(endpoint_id):
    query = f'''
    mutation {{
        deleteEndpoint(id: "{endpoint_id}")
    }}
    '''
    response = requests.post(
        "https://api.runpod.io/graphql",
        headers={"Authorization": f"Bearer {api_key}", "Content-Type": "application/json"},
