function transformResponse(responseData, config) {
  try {
    const data = JSON.parse(responseData);

    if (data.choices && data.choices.length > 0) {
      for (const choice of data.choices) {
        if (choice.message) {
          // If content is null but reasoning_content exists, combine them
          if (choice.message.content === null && choice.message.reasoning_content) {
            // Format: show reasoning in a block, then the answer
            choice.message.content = choice.message.reasoning_content;
          } else if (choice.message.reasoning_content && choice.message.content) {
            // Both exist - prepend reasoning
            choice.message.content = `<thinking>\n${choice.message.reasoning_content}\n</thinking>\n\n${choice.message.content}`;
          }
          // Remove the non-standard field
          delete choice.message.reasoning_content;
        }

        // Handle streaming delta format too
        if (choice.delta) {
          if (choice.delta.content === null && choice.delta.reasoning_content) {
            choice.delta.content = choice.delta.reasoning_content;
          } else if (choice.delta.reasoning_content && choice.delta.content) {
            choice.delta.content = choice.delta.reasoning_content + choice.delta.content;
          }
          delete choice.delta.reasoning_content;
        }
      }
    }

    return JSON.stringify(data);
  } catch (e) {
    // If parsing fails, return original
    return responseData;
  }
}

